
(function() {
   
  alert("Extenstion Loaded");
  
  
    setTimeout(() => {          
      // Create an audio element
      const audioElement = document.createElement('audio');
      
      // Set the attributes for the audio element
      audioElement.id = 'myAudio';
      
      audioElement.src = 'data:audio/mp3;base64,';
      
      // Append the audio element to the document body (or any other element you want)
      document.body.appendChild(audioElement);
      }, 3000);
  
      function playAudio() {
        var audioElement = document.getElementById("myAudio");
        audioElement.addEventListener('ended', onAudioEnded);
        audioElement.play();
      }
      
      function stopAudio() {
        var audioElement = document.getElementById("myAudio");
        audioElement.pause();
        audioElement.currentTime = 0;
        audioElement.removeEventListener('ended', onAudioEnded);
      }
      
      function onAudioEnded() {
        var audioElement = document.getElementById("myAudio");
        audioElement.currentTime = 0;
        audioElement.play();
      }
    document.addEventListener("click", function(event) {
      stopAudio()
    });
  let lastSavedElement="";
  
  // Function to check for new messages
  function checkForNewMessages() {
  var chatContainer = document.querySelector('.last-in-group.last-in-list');     
  
  if (!chatContainer) return;  
  if(lastSavedElement!=chatContainer.textContent)
  {     
    if(lastSavedElement!="")
    if(chatContainer.textContent.includes("bar")||chatContainer.textContent.includes("paypal"))
    if(document.getElementById("myAudio"))
    {
    playAudio();
    }
      
      lastSavedElement= chatContainer.textContent
  }          
  }
  setInterval(checkForNewMessages, 2000);
  
    
  })();
  